LOOP
   v_total_of_payments_thus_far_received := a.total_of_payments_thus_far_received;
   v_total_of_totals_of_payments_expected_to_be_received := a.total_of_payments_expected_to_be_received;

   IF v_total_of_payments_thus_far_received = v_total_of_payments_expected_to_be_received THEN

   CONTINUE;
   
   ELSE 
   UPDATE uc_meta_bus_proc_contracts_participants_approvals_accumulations SET total_of_payments_thus_far_received = v_total_of_payments_thus_far_made + v_amount;
   UPDATE uc_meta_bus_proc_contracts_participants_approvals_accumulations SET number_of_payments_received_approval_given = v_number_of_payments_received_approval_given + 1;
   EXIT;
END IF;
END LOOP;

SELECT total_expected_credits INTO v_total_expected_credits FROM uc_meta_bus_processes_contracts WHERE contract_id = v_smart_contract_id;

FOR rec5 IN 
   SELECT DISTINCT ON (a.participant_id) a.total_of_payments_expected_to_be_received
   FROM uc_meta_bus_proc_contracts_participants_approvals_accumulations a
   WHERE a.contract_id = v_smart_contract_id
   ORDER BY participant_id

LOOP
    v_total_of_payments_expected_to_be_received := a.total_of_payments_expected_to_be_received;
    v_total_of_totals_of_payments_expected_to_be_received := a.v_total_of_totals_of_payments_expected_to_be_received + v_total_of_payments_expected_to_be_received;
    
  END LOOP;

FOR rec4 IN 
   SELECT DISTINCT ON (a.participant_id) a.total_of_payments_expected_to_be_made
   FROM uc_meta_bus_proc_contracts_participants_approvals_accumulations a
   WHERE a.contract_id = v_smart_contract_id
   ORDER BY participant_id

LOOP
    v_total_of_payments_expected_to_be_made := a.total_of_payments_expected_to_be_made;
    v_total_of_totals_of_payments_expected_to_be_made = v_total_of_totals_of_payments_to_be_made + v_total_of_payments_expected_to_be_made;

  END LOOP;

FOR rec6 IN                                                                              
   SELECT DISTINCT ON (a.participant_id) a.total_of_payments_thus_far_made, a.total_of_payments_thus_far_received, a.number_of_payments_made_approval_given, a.number_of_payments_received_approval_given, a.total_of_payments_expected_to_be_made, a.total_of_payments_expected_to_be_received
   FROM uc_meta_bus_proc_contracts_participants_approvals_accumulations a
   WHERE a.contract_id = v_smart_contract_id
   ORDER BY createdAt, updatedAt

   LOOP

   v_number_of_payments_made_approval_given := a.number_of_payments_made_approval_given;
   v_number_of_payments_received_approval_given := a.number_of_payments_received_approval_given;
   v_total_of_payments_expected_to_be_made := a.total_of_payments_expected_to_be_made;
   v_total_of_payments_expected_to_be_received := a.total_of_payments_expected_to_be_received;
   v_total_of_payments_thus_far_made := a.total_of_payments_thus_far_made;
   v_total_of_payments_thus_far_received := a.total_of_payments_thus_far_received;

   v_total_of_totals_of_payments_thus_far_made = v_total_of_totals_of_payments_thus_far_made + v_total_of_payments_thus_far_made;
   v_total_of_totals_of_payments_expected_to_be_made = v_total_of_totals_of_payments_expected_to_be_made + v_total_of_payments_expected_to_be_made;
   v_total_of_totals_of_payments_thus_far_received = v_total_of_totals_of_payments_thus_far_received + v_total_of_payments_thus_far_received;
   v_total_of_totals_of_payments_expected_to_be_received = v_total_of_totals_of_payments_expected_to_be_received + v_total_of_payments_expected_to_be_received;
   v_total_of_numbers_of_payments_made_approval_given = v_total_of_numbers_of_payments_made_approval_given + v_number_of_payments_made_approval_given;
   v_total_of_numbers_of_payments_received_approval_given = v_total_of_numbers_of_payments_received_approval_given + v_number_of_payments_received_approval_given;

   END LOOP;

   IF v_total_of_totals_of_payments_expected_to_be_made = v_total_of_totals_of_payments_expected_to_be_received
  
   AND v_total_of_numbers_of_payments_received_approval_given = v_total_of_numbers_of_payments_made_approval_given                                                                                                                           
   AND v_total_of_totals_of_payments_thus_far_made = v_total_of_totals_of_payments_thus_far_received
   AND v_total_of_totals_of_payments_thus_far_made = v_total_expected_credits
   
   THEN 
   FOR rec2 IN SELECT acctcredlev1id, acctcredlev1name, acctcredlev2name, acctcredlev3name, acctcredlev4name, acctcredlev5name, acctcredlev6name, acctdeblev1name, acctdeblev2name, acctdeblev3name, acctdeblev4name, acctdeblev5name, acctdeblev6name, accttdeblev1id, amount, amount_overalltx, assetid, assettxid, branchname, classlev1id, classlev2id, classlev3id, credited_ledger_title, debited_ledger_title, createdAt, updatedAt, customerid, datereconciled, devordersid, docvaultfolderid, employeeid, employeetxid, entbranchid, entnum, feeid, jobnum, keytransid, maintorderid, meta_proc_id, notes, programid, programname, projectid, projectname, propid, proptxid, purchordernum, suppid, tax1amount, tax2amount, taxcode1, taxcode2, tenancynum, txdate, txtype, uname, unitnum, updatedAt
        FROM accounting_financialtxjournals
          WHERE entnum = v_entnum AND meta_bus_proc_id = v_meta_bus_proc_id

   LOOP

       INSERT INTO accounting_financialtxjournals (acctcredlev1id, acctcredlev1name, acctcredlev2name, acctcredlev3name, acctcredlev4name, acctcredlev5name, acctcredlev6name, acctdeblev1name, acctdeblev2name, acctdeblev3name, acctdeblev4name, acctdeblev5name, acctdeblev6name, accttdeblev1id, amount, amount_overalltx, assetid, assettxid, branchname, classlev1id, classlev2id, classlev3id, createdAt, updatedAt, customerid, credited_ledger_title, debited_ledger_title, datereconciled, devordersid, docvaultfolderid, employeeid,  employeetxid, entbranchid, entnum, feeid, jobnum, keytransid, maintorderid, meta_proc_id, notes, programid, programname, projectid, projectname, propid, proptxid, purchordernum, smart_contract_id, suppid,  tax1amount, tax2amount, taxcode1, taxcode2, tenancynum, txdate, txtype, uname, unitnum)
              VALUES (rec2.acctdeblev1id, rec2.acctdeblev1name, rec2.acctdeblev2name, rec2.acctdeblev3name, rec2.acctdeblev4name, rec2.acctdeblev5name, rec2.acctdeblev6name, rec2.acctcredlev1name, rec2.acctcredlev2name, rec2.acctcredlev3name, rec2.acctcredlev4name, rec2.acctcredlev5name, rec2.acctcredlev6name, rec2.accttcredlev1id, rec2.amount, rec2.amount_overalltx, rec2.assetid, rec2.assettxid, rec2.branchname, rec2.classlev1id, rec2.classlev2id, rec2.classlev3id, rec2.createdAt, rec2.updatedAt, rec2.customerid, rec2.credited_ledger_title, rec2.debited_ledger_title, rec2.datereconciled, rec2.devordersid, rec2.docvaultfolderid, rec2.employeeid, rec2.employeetxid, rec2.entbranchid, rec2.entnum, rec2.feeid, rec2.jobnum, rec2.keytransid, rec2.maintorderid, rec2.meta_proc_id, rec2.notes, rec2.programid, rec2.programname, rec2.projectid, rec2.projectname, rec2.propid, rec2.proptxid, rec2.purchordernum, rec2.smart_contract_id, rec2.suppid, rec2.tax1amount, rec2.tax2amount, rec2.taxcode1, rec2.taxcode2, rec2.tenancynum, rec2.txdate, rec2.txtype, rec2.uname, rec2.unitnum);

   END LOOP;
      
   FOR rec3 IN SELECT acctcredlev1id, acctcredlev1name, acctcredlev2name, acctcredlev3name, acctcredlev4name, acctcredlev5name, acctcredlev6name, acctdeblev1name, acctdeblev2name, acctdeblev3name, acctdeblev4name, acctdeblev5name, acctdeblev6name, accttdeblev1id, amount, amount_overalltx, assetid, assettxid, branchname, classlev1id, classlev2id, classlev3id, createdAt, credited_ledger_title, debited_ledger_title, customerid, datereconciled, devordersid, docvaultfolderid, employeeid, employeetxid, entbranchid, entnum, feeid, jobnum, keytransid, maintorderid, meta_proc_id, notes, programid, programname, projectid, projectname, propid, proptxid, purchordernum, smart_contract_id, suppid, tax1amount, tax2amount, taxcode1, taxcode2, tenancynum, txdate, txtype, uname, unitnum, updatedAt
        FROM uc_accounting_journal_entries
          WHERE entnum = v_entnum AND meta_bus_proc_id = v_meta_bus_proc_id

   LOOP

       INSERT INTO accounting_financialtxjournals (acctcredlev1id, acctcredlev1name, acctcredlev2name, acctcredlev3name, acctcredlev4name, acctcredlev5name, acctcredlev6name, acctdeblev1name, acctdeblev2name, acctdeblev3name, acctdeblev4name, acctdeblev5name, acctdeblev6name, accttdeblev1id, amount, amount_overalltx, assetid, assettxid, branchname, classlev1id, classlev2id, classlev3id, createdAt, customerid, datereconciled, devordersid, docvaultfolderid, employeeid,  employeetxid, entbranchid, entnum, feeid, jobnum, keytransid, maintorderid, meta_proc_id, notes, programid, programname, projectid, projectname, propandacctclassid, propid, proptxid, purchordernum, smart_contract_id, suppid,  tax1amount, tax2amount, taxcode1, taxcode2, tenancynum, txdate, txtype, uname, unitnum, updatedAt)
              VALUES (rec3.acctcredlev1id, rec3.acctcredlev1name, rec3.acctcredlev2name, rec3.acctcredlev3name, rec3.acctcredlev4name, rec3.acctcredlev5name, rec3.acctcredlev6name, rec3.acctdeblev1name, rec3.acctdeblev2name, rec3.acctdeblev3name, rec3.acctdeblev4name, rec3.acctdeblev5name, rec3.acctdeblev6name, rec3.accttcredlev1id, rec3.amount, rec3.amount_overalltx, rec3.assetid, rec3.assettxid, rec3.branchname, rec3.classlev1id, rec3.classlev2id, rec3.classlev3id, rec3.createdAt, rec3.customerid, rec3.datereconciled, rec3.devordersid, rec3.docvaultfolderid, rec3.employeeid, rec3.employeetxid, rec3.entbranchid, rec3.entnum, rec3.feeid, rec3.jobnum, rec3.keytransid, rec3.maintorderid, rec3.meta_proc_id, rec3.notes, rec3.programid, rec3.programname, rec3.projectid, rec3.projectname, rec3.propid, rec3.proptxid, rec3.purchordernum, rec3.smart_contract_id, rec3.suppid, rec3.tax1amount, rec3.tax2amount, rec3.taxcode1, rec3.taxcode2, rec3.tenancynum, rec3.txdate, rec3.txtype, rec3.uname, rec3.unitnum, rec3.updatedAt);

