--
-- Name: mrq_order_approve_or_cancel(); Type: FUNCTION; Schema: cheirrs_oseer; Owner: postgres
--

CREATE FUNCTION cheirrs_oseer.mrq_order_approve_or_cancel() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
v_mrq_id bigint := NEW.mrq_a;
v_entnum_a bigint := NEW.entnum_a;
v_approved boolean := NEW.approved_a;
v_cancelled boolean := NEW.cancelled_a;
v_notes text := NEW.notes_a;
v_suppid_a bigint :=NEW.suppid_a;
v_next_purch_order_num bigint;
v_following_purchordernum bigint;
BEGIN

IF v_approved = true THEN

SELECT nextpurchordernum INTO v_next_purch_order_num FROM publicenterprisesheaders WHERE entnum = v_entnum_a;

UPDATE uc_maintreq_systems SET orderapproved = true, notes = v_notes, suppid = v_suppid_a, orderopendate = NOW(), purchordernum = v_next_purch_order_num, quote_id_for_order = quote_id_for_order_a WHERE mrq_id = v_mrq_id;

v_following_purchordernum = v_next_purch_order_num;

UPDATE accounting_enterprisesheaders SET next_purch_order_num = v_following_purchordernum WHERE entnum = v_entnum_a;

ELSIF v_cancelled = true THEN 

UPDATE uc_maintreq_systems SET ordercancelled = true, notes = v_notes WHERE mrq_id = v_mrq_id;

ELSIF v_approved = false AND v_cancelled = false THEN

UPDATE uc_maintreq_systems SET notes = v_notes, order_pendingapproval_date = NOW() WHERE mrq_id = v_mrq_id;

END IF;

RETURN 0;

END;$$;


ALTER FUNCTION cheirrs_oseer.mrq_order_approve_or_cancel() OWNER TO postgres;

