--

CREATE FUNCTION cheirrs_oseer.mrq_register_contract() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
v_mrq_a bigint := NEW.mrq_a;
v_date_for_supply_a TIMESTAMPTZ := NEW.date_for_supply_a;
v_dateofreq_a TIMESTAMPTZ := NEW.dateofreq_a;
v_docvaultid_a bigint := NEW.docvaultid_a;
v_imagevaultid_a bigint := NEW.imagevaultid_a;
v_jobdescr_a text := NEW.jobdescr_a;
v_jobtypesid_a bigint := NEW.jobtypesid_a;
v_maintpriorityid_a bigint := NEW.maintpriorityid_a;
v_mainttypeid_a bigint := NEW.mainttypeid_a;
v_jobtype_a varchar := NEW.jobtype_a;
v_notes_a text := NEW.notes_a;
v_orderpendingdate_a TIMESTAMPTZ := NEW.orderpendingdate_a;
v_approved_a boolean := NEW.approved_a;
v_cancelled_a boolean := NEW.cancelled_a;
v_orderopendate_a TIMESTAMPTZ := NEW.orderopendate_a;
v_ourresponsibility_a boolean := NEW.ourresponsibility_a;
v_priority_a varchar := NEW.priority_a;
v_probsummary_a text := NEW.probsummary_a;
v_propid_a bigint := NEW.propid_a;
v_purchordernum_a bigint := NEW.purchordernum_a;
v_suppid_a bigint := NEW.suppid_a;
v_uname_a varchar := NEW.uname_a;
v_entnum_a bigint := NEW.entnum_a;
v_unitnum_a varchar := NEW.unitnum_a;
v_bus_proc_id_a bigint := NEW.bus_proc_id_a;
v_abn int := NEW.abn;
v_acceptsemailorders boolean := NEW.acceptsemailorders;
v_acceptsphoneorders boolean := NEW.acceptsphoneorders;
v_acceptswrittenorders boolean := NEW.acceptswrittenorders;
v_contact varchar := NEW.contact;
v_telephonenum int := NEW.telephonenum;
v_emailaddress varchar := NEW.emailaddress;
v_postaladdressline1 varchar := NEW.postaladdressline1;
v_postaladdressline2 varchar := NEW.postaladdressline2;
v_postalsuburbid bigint := NEW.postalsuburbid;
v_postalsuburbtown varchar := NEW.postalsuburbtown;
v_poststate varchar := NEW.poststate;
v_postcode int := NEW.postcode;
v_suppliername varchar := NEW.suppliername;
v_suppliertype varchar := NEW.suppliertype;
v_suppliersheaderid bigint := NEW.suppliersheaderid;
v_parent_contract_id bigint := NEW.parent_contract_id;
v_child_contract_id bigint := NEW.child_contract_id;
v_contract_name varchar := NEW.contract_name;
v_contract_type_name varchar := NEW.contract_type_name;
v_contract_id bigint := NEW.contract_id;
v_contract_type_id bigint := NEW.contract_type_id;
v_num_payment_making_parties_to_satisfy int := NEW.num_payment_making_parties_to_satisfy;
v_num_payment_receiving_parties_to_satisfy int := NEW.num_payment_receiving_parties_to_satisfy;
v_total_expected_credits double precision := NEW.total_expected_credits;
v_nextparticipantnum bigint;
v_new_nextparticipantnum bigint;
v_thisparticipantnum bigint;
v_secondparticipantnum bigint;
v_this_second_participantnum bigint;
v_party1_id bigint; 
v_supp_id bigint;
v_party2_id bigint;
v_prop_id bigint;
v_meta_bus_proc_type_id bigint;
v_contractid bigint;
BEGIN

SELECT nextparticipantnum INTO v_nextparticipantnum FROM accounting_enterprisesheaders WHERE entnum = v_entnum_a;

   IF NOT (SELECT supplierid
     FROM uc_meta_bus_proc_contract_participant_register
     WHERE uc_meta_bus_proc_contract_participant_register.supplierid = v_suppliersheaderid)
	 THEN
	 INSERT INTO uc_meta_bus_proc_contract_participant_register (smart_contract_participant_id, supplierid) VALUES (v_nextparticipantnum, v_suppliersheaderid);
	 END IF;

v_new_nextparticipantnum := v_nextparticipantnum + 1;

   IF NOT (SELECT supplierid
     FROM uc_meta_bus_proc_contract_participant_register
     WHERE uc_meta_bus_proc_contract_participant_register.supplierid = v_suppliersheaderid)	 
   THEN
   UPDATE accounting_enterprisesheaders SET nextparticipantnum = v_new_nextparticipantnum WHERE entnum = v_entnum_a;
   END IF;

SELECT nextparticipantnum INTO v_secondparticipantnum FROM accounting_enterprisesheaders WHERE entnum = v_entnum_a;

    IF NOT (SELECT propertyid
     FROM uc_meta_bus_proc_contract_participant_register
     WHERE uc_meta_bus_proc_contract_participant_register.propertyid = v_propid_a)
	THEN
     INSERT INTO uc_meta_bus_proc_contract_participant_register (smart_contract_participant_id, propertyid) VALUES (v_secondparticipantnum, v_propid_a);
	END IF;
	
v_new_nextparticipantnum := v_secondparticipantnum + 1;	

    IF NOT (SELECT propertyid
     FROM uc_meta_bus_proc_contract_participant_register
     WHERE uc_meta_bus_proc_contract_participant_register.propertyid = v_propid_a)
    THEN
     UPDATE accounting_enterprisesheaders SET nextparticipantnum = v_new_nextparticipantnum WHERE entnum = v_entnum_a;
	END IF;
	
SELECT smart_contract_participant_id, supplierid INTO v_party1_id, v_supp_id FROM uc_meta_bus_proc_contract_participant_register WHERE uc_meta_bus_proc_contract_participant_register.supplierid = v_suppliersheaderid;

SELECT smart_contract_participant_id, propertyid INTO v_party2_id, v_prop_id FROM uc_meta_bus_proc_contract_participant_register WHERE uc_meta_bus_proc_contract_participant_register.propertyid = v_propid_a;

INSERT INTO uc_meta_bus_proc_contracts_participants_join (participant_id, contract_id) VALUES (v_party1_id, v_contract_id);

INSERT INTO uc_meta_bus_proc_contracts_participants_join (participant_id, contract_id) VALUES (v_party2_id, v_contract_id);

SELECT DISTINCT ON ( entnum = v_entnum_a AND meta_bus_proc_id = v_bus_proc_id_a ) meta_bus_proc_type_id FROM uc_meta_bus_processes INTO v_meta_bus_proc_type_id;

SELECT nextcontracttnum INTO v_contractid FROM accounting_enterprisesheaders WHERE entnum = v_entnum_a;

UPDATE uc_meta_bus_processes SET contract_id = v_contract_id WHERE entnum = v_entnum_a AND meta_bus_proc_id = v_bus_proc_id_a;

INSERT INTO uc_meta_bus_processes_contracts (uname, entnum, related_to_bus_proc_type_id, contract_id, contract_name, contract_type_name, docvaultfolderid, imagevaultfolderid, meta_bus_proc_id, commence_date_contract, contract_type_id, num_payment_making_parties_to_satisfy, num_payment_receiving_parties_to_satisfy, total_expected_credits) 
VALUES (v_uname_a, v_entnum_a, v_meta_bus_proc_type_id, v_contract_id, v_contract_name, v_contract_type_name, v_docvaultid_a, v_imagevaultid_a, v_bus_proc_id_a, NOW(), v_contract_type_id, v_num_payment_making_parties_to_satisfy, v_num_payment_receiving_parties_to_satisfy, v_total_expected_credits);

RETURN 0;

END;$$;


