--
-- Name: updatemaster(); Type: FUNCTION; Schema: cheirrs_oseer; Owner: postgres
--

CREATE FUNCTION cheirrs_oseer.updatemaster() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
        
        v_user name;
        v_old_balance double precision := 0;
	v_old_balance_2 double precision := 0;
