CREATE VIEW cheirrs_oseer.mrq_register_contract_view WITH (security_barrier='false') AS
 SELECT a.mrq_id AS mrq_a,
    a.dateforsupplycommencement AS dateforsupply_a,
    a.dateofrequest AS dateofreq_a,
    a.docvaultfolderid AS docvaultid_a,
    a.imagevaultfolderid AS imagevaultid_a,
    a.jobdescription AS jobdescr_a,
    a.jobnum AS jobnum_a,
    a.jobtypesid AS jobtypesid_a,
    a.maintpriorityid AS maintpriorityid_a,
    a.mainttypeid AS mainttypeid_a,
    a.jobtype AS jobtype_a,
    a.notes AS notes_a,
    a.order_pendingapproval_date AS orderpendingdate_a,
    a.orderapproved AS approved_a,
    a.ordercancelled AS cancelled_a,
    a.orderopendate AS orderopendate_a,
    a.ourresponsibility AS ourresponsibility_a,
    a.priority AS priority_a,
    a.problemsummary AS probsummary_a,
    a.propid AS propid_a,
    a.purchordernum AS purchordernum_a,
    a.suppid AS suppid_a,
    a.uname AS uname_a,
    a.entnum AS entnum_a,
    a.unitnum AS unitnum_a,
    a.meta_bus_proc_id AS bus_proc_id_a,
    b.mrq_id AS mrq_b,
    b.suppid_selected AS suppid_b,
    c.abn,
    c.acceptsemailorders,
    c.acceptsphoneorders,
    c.acceptswrittenorders,
    c.contact,
    c.telephonenum,
    c.emailaddress,
    c.postaladdressline1,
    c.postaladdressline2,
    c.postalsuburbid,
    c.postalsuburbtown,
    c.poststate,
    c.postcode,
    c.suppliername,
    c.suppliertype,
    c.suppliersheaderid,
    d.parent_contract_id,
    d.entnum,
    d.child_contract_id,
    d.contract_name,
    d.contract_type_name,
    d.contract_id,
    d.num_payment_making_parties_to_satisfy,
    d.num_payment_receiving_parties_to_satisfy,
    d.total_expected_credits,
    d.success,
    d.contract_type_id
   FROM (((cheirrs_oseer.uc_maintreq_systems a
     JOIN cheirrs_oseer.uc_manage_quotes b ON ((b.mrq_id = a.mrq_id)))
     JOIN cheirrs_oseer.accounting_suppliersheaders c ON ((c.suppliersheaderid = b.suppid_selected)))
     JOIN cheirrs_oseer.uc_meta_bus_processes_contracts d ON ((d.meta_bus_proc_id = a.meta_bus_proc_id)));


